  constructor(props) {
    super(props)
    this.state = store.getState()
  }
  render() {
    return ( <
      Fragment >
      <
      Input placeholder = "输入内容"
      style = {
        {
          width: '250px'
        }
      }
      value = {
        this.state.inputValue
      }
      /> <
      Button type = "primary" > 增加 < /Button> <
      List bordered dataSource = {
        this.state.list
      }
      renderItem = {
        item => ( <
          List.Item > {
            item
          } < /List.Item>
        )
      } >
      < /List> <
      /Fragment>
    )
  }
}


export default TodoList
